Plot: Samuel Planck is head of the HELIOS PROJECT - a high tech facility tasked with storing and converting solar rays into an endless supply of renewable energy. After years of research and millions of dollars, it is now time to test the system out. The scientists cheer loudly as initially things go according to plan. But when the facility is unable to control the massive amount of energy coming in, the cheers turn to screams. The charged particles begin swirling around themselves, creating a massive magnetic vortex that quickly becomes the first magnetic tornado on earth!

